import './styles/App.css';
function Intro() {
  return (
    <div className='app-body'>
      <div className='app-content'>
        <header className="app-header">
          <div className='logo'>
            <h1 className='logo-name'>American Dream</h1>
            <img className='logo-img'src={logo}/>
          </div>
        </header>
        
      </div>
    </div>
  );
}

export default Intro;
